import React from 'react';

class ClickAway extends React.Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
        <div id="clickAwayFrame">
                <div className="clickAway1">

                </div>

                <div className="clickAway2">

                </div>

                <div className="clickAway3">

                </div>

                <div className="clickAway4">

                </div>

              <style jsx>
                  {`

                  #clickAwayFrame {
                      position: fixed;
                      top: 1px;
                      z-Index: 5;
                      
                  }
                  
                  .clickAway1 {
                      position: fixed;
                      height: 100vh;
                      width: 4.8vw;
                      background-color: red;
                      z-Index: 50;
                  }

                  .clickAway2 {
                    position: fixed;
                    height: 217px;
                    width: 100vw;
                    background-color: red;
                    z-Index: 50;
                    margin-top: 0px;
                }

                .clickAway3 {
                    right: 0px;
                    position: fixed;
                    height: 100vh;
                    width: 4.8vw;
                    background-color: red;
                    z-Index: 50;
                }

                .clickAway4 {
                    position: fixed;
                    height: 10.5vh;
                    width: 100vw;
                    background-color: red;
                    z-Index: 50;
                    transform: translate(0,90)
                }
                  
                  `}
              </style>
        </div>
        )
    }
}

export default ClickAway;
